import React from "react";
import { css, styled } from "styled-components";

const Button = ({ children, size, variant = "outlined", ...rest }) => {
  if (variant === "oulined") {
    return "#442424";
  }
  return (
    <button size={size} variant={getVariant} {...rest}>
      {children}
    </button>
  );
};

export default Button;


const ButtonStyle=styled.button`
  padding: 8px 16px;
  border-radius: 4px;
  font-size: 16px;
  cursor: pointer;
`
